import React from 'react'
import useSpline from '@splinetool/r3f-spline'
import {Canvas} from "@react-three/fiber"
import { OrbitControls, OrthographicCamera } from '@react-three/drei'



function Rocket() {
  const { nodes, materials } = useSpline('https://prod.spline.design/Elc6ufW4UVGUN7XA/scene.splinecode')
  return (
    <Canvas>
      <OrbitControls/>
     
      <group  dispose={null}>
        <scene name="Scene">
          <OrthographicCamera
            name="Camera 1"
            makeDefault={true}
            zoom={1.36}
            far={100000}
            near={-100000}
            position={[2.79, -28.87, 1010.14]}
            rotation={[0, 0, 0]}
          />
          <pointLight
            name="Point Light"
            intensity={0.9}
            decay={2}
            distance={4246}
            shadow-mapSize-width={1024}
            shadow-mapSize-height={1024}
            shadow-camera-near={100}
            shadow-camera-far={2500}
            color="#e4e4fe"
            position={[-84.32, 147.45, 0]}
          />
          <group name="rocket" position={[-10.08, -438.5, 151.37]} scale={3.79}>
            <pointLight
              name="Point Light1"
              intensity={1}
              distance={5061}
              shadow-mapSize-width={1024}
              shadow-mapSize-height={1024}
              shadow-camera-near={100}
              shadow-camera-far={2500}
              color="#feead6"
              position={[1.07, 30.66, 36.9]}
              rotation={[0, 0, 0]}
            />
            <group name="fire-state" position={[0, -14.56, 0]} scale={[0.72, 0.52, 0.78]}>
              <group name="fire-loop" position={[0, 4.32, 0]}>
                <mesh
                  name="Lathe 2"
                  geometry={nodes['Lathe 2'].geometry}
                  material={materials['Lathe 2 Material']}
                  castShadow
                  receiveShadow
                  position={[0, 7.68, 0]}
                  scale={[0.99, 2.62, 0.99]}
                />
              </group>
            </group>
            <mesh
              name="cabin"
              geometry={nodes.cabin.geometry}
              material={materials['cabin Material']}
              castShadow
              receiveShadow
              position={[0, 164.49, 16.6]}
              rotation={[-0.13, 0, 0]}
              scale={[1.09, 1.53, 1.09]}
            />
            <mesh
              name="flank"
              geometry={nodes.flank.geometry}
              material={materials['flank Material']}
              visible={true}
              castShadow
              receiveShadow
              position={[1.53, 122.93, -1.53]}
              rotation={[0, -Math.PI / 4, 0]}
              scale={[1.4, 1.11, 1.4]}
            />
            <group name="d" position={[0, 56.83, 0.67]}>
              <mesh
                name="Cylinder 2"
                geometry={nodes['Cylinder 2'].geometry}
                material={materials['Cylinder 2 Material']}
                castShadow
                receiveShadow
                position={[0, 6.96, 0]}
                rotation={[Math.PI, Math.PI / 2, 0]}
                scale={[0.32, 0.07, 0.32]}
              />
              <mesh
                name="Cylinder"
                geometry={nodes.Cylinder.geometry}
                material={materials['Cylinder Material']}
                castShadow
                receiveShadow
                position={[0, 8.08, 0]}
                rotation={[Math.PI, Math.PI / 2, 0]}
                scale={[0.35, 0.07, 0.35]}
              />
            </group>
            <mesh
              name="body"
              geometry={nodes.body.geometry}
              material={materials['body Material']}
              castShadow
              receiveShadow
              position={[0, 127.23, 0.67]}
              scale={[1.09, 1.85, 1.09]}
            />
          </group>
          <directionalLight
            name="Directional Light"
            intensity={1.5}
            shadow-mapSize-width={1024}
            shadow-mapSize-height={1024}
            shadow-camera-near={-10000}
            shadow-camera-far={100000}
            shadow-camera-left={-1000}
            shadow-camera-right={1000}
            shadow-camera-top={1000}
            shadow-camera-bottom={-1000}
            color="#fef2dc"
            position={[200, 300, 300]}
          />
         
        </scene>
      </group>
    </Canvas>
  )
}

export default Rocket
